# This is a sample config file. It was tested with:
# 
#      Compiler name/version:       [gcc, 4.2 snapshot 20060325]
#      Operating system version:    [SLES9 SP3 for AMD64]
#      Hardware:                    [Opteron]
#
# If your platform uses different versions, different
# hardware or operates in a different mode (for 
# example, 32- vs. 64-bit mode), there is the possibiliy
# that this configuration file may not work as-is. 
# 
# Note that issues with compilation should be directed
# to the compiler vendor. Information about SPEC techncial
# support can be found in the techsupport document in the
# Docs directory of your benchmark installation.
#
# Also note that this is a sample configuration. It
# is expected to work for the environment in which
# it was tested; it is not guaranteed that this is 
# the config file that will provide the best performance.
# 
# Note that you might find a more recent config file for
# your platform with the posted results at
# www.spec.org/cpu2006
####################################################################
# linux-mipsel-gcc.cfg 
# FSF's gcc 4.2 config file for
# AMD64 32-bit (32 bit binaries on 64 bit linux)
# Config file for CPU2006-kit90 Int and Fp base only
#####################################################################
backup_config = 1
ignore_errors = yes
tune          = base,peak
ext           = loongson
output_format = asc, csv,html, screen, pdf, config
reportable    = 0
teeout        = yes
teerunout     = yes
hw_avail = Feb-2022
sw_avail = Feb-2022
license_num = 
company_name = Loongson 
prepared_by = Loongson
tester_name = zevan
test_date = Feb-2022

verbose    = 9
parallel  = yes
sw_parallel_other  = yes

# These bind settings are configured for a 1 socket system
# with 4 cores per socket - you might need to adjust these
# for your specific platform.
bind0  = numactl -m 0 --physcpubind=0
bind1  = numactl -m 0 --physcpubind=1
bind2  = numactl -m 0 --physcpubind=2
bind3  = numactl -m 0 --physcpubind=3

submit = $BIND $command
makeflags = -j 4
## HW config
hw_cpu_name  = Loongson
hw_model     = 3A5000
hw_cpu_mhz   = 2500
hw_fpu       = Integrated
hw_nchips	= 1
hw_ncores	= 1
hw_ncoresperchip= 1
hw_nthreads	= 1
hw_ncpuorder = 1
hw_parallel  = yes
hw_pcache    = 64KB I + 64KB D
hw_scache    = 16384KB(I + D)
hw_memory	= 2 x 16GB DDR4 3200 
hw_vendor	= Loongson

## SW config
sw_os        = Loongnix
sw_file      = ext4
sw_state     = runlevel 3
sw_compiler  = gcc , g++ & gfortran 8.3

